import React, { Component } from 'react'

export default class ShowLocation extends Component {
    render() {
        return (
            <div>
                                <table>
                <thead>
                    <tr>
                        <th>Latitude</th>
                        <th>Longitude</th>
                    </tr>
                </thead>
                <tbody>
                {this.state.location.map((item) => (
                   <tr key={item.id}>
                       <td>{item.latitude}</td>
                       <td>{item.longitude}</td>
                       <td><Button size='small' variant="contained" color="secondary" onClick={()=>this.delete(item.id)}>Delete</Button></td>
                   </tr>
                ))}
                </tbody>
                </table>
            </div>
        )
    }
}
